import './App.css';
import LoginForm from './components/LoginForm';
import Navigator from './components/Navigator';
import {Route, Router ,Routes,HashRouter, BrowserRouter, Link, Switch} from "react-router-dom";
import Home from './components_css/pages/Home';
import Example from './components_css/pages/Example';
import { useCallback } from 'react';
import ErrorPage from './components_css/pages/ErrorPage';
import {ErrorBoundary} from "react-error-boundary";

function App() {

  return (
    <div>
      <ErrorBoundary>

      <BrowserRouter>
        <Navigator/>
        <Switch>
        <Routes>
          <Route path="/" exact element={<Home/>} /> 
          <Route path="/example" element={<Example/>} />
          <Route path="/login" element={<LoginForm/>} /> 
        </Routes>
        <Link to="login">Login 하러가기</Link>
        </Switch>
      </BrowserRouter>
      </ErrorBoundary>



    </div>
  );
}

export default App;
